//Reference: https://reactnavigation.org/docs/material-bottom-tab-navigator/
import React from 'react';

import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';

import Icon from 'react-native-vector-icons/Ionicons';
import { createDrawerNavigator } from '@react-navigation/drawer';

import MainScreen from './MainScreen';
import HistoryScreen from './HistoryScreen';
import NotificationScreen from './NotificationScreen';
import UserProfileScreen from './UserProfileScreen';

const HomeStack = createStackNavigator();


const Tab = createMaterialBottomTabNavigator();

const BottomTabScreen = () => (
    <Tab.Navigator
      initialRouteName="Home"
      activeColor="#fff"       
    >
      <Tab.Screen
        name="Home"
        component={MainScreen}
        options={{
          tabBarLabel: 'Home',
          tabBarColor: '#7158B7',
          tabBarIcon: () => (
            <Icon name="home" color="#fff" size={26} />
          ),
        }}
      />
      <Tab.Screen
        name="Notifications"
        component={HistoryScreen}
        options={{
          tabBarLabel: 'History',
          tabBarColor: '#7158B7',
          tabBarIcon: () => (
            <Icon name="time-outline" color="#fff" size={26} />
          ),
        }}
      />
      <Tab.Screen
        name="Profile"
        component={NotificationScreen}
        options={{
          tabBarLabel: 'Notifications',
          tabBarColor: '#7158B7',
          tabBarIcon: () => (
            <Icon name="notifications" color="#fff" size={26} />
          ),
        }}
      />
      <Tab.Screen
        name="Explore"
        component={UserProfileScreen}
        options={{
          tabBarLabel: 'Profile',
          tabBarColor: '#7158B7',
          tabBarIcon: () => (
            <Icon name="person" color="#fff" size={26} />
          ),
        }}
      />
    </Tab.Navigator>
);

export default BottomTabScreen;

